package classfyone.easy;

import com.utils.StringUtils;

import java.util.*;
import java.util.stream.Collectors;

/**
 * 题目：找出字符串中第一个匹配项的下标
 * 给你两个字符串 haystack 和 needle ，
 * 请你在 haystack 字符串中找出 needle字符串的第一个匹配项的下标（下标从 0 开始）。
 * 如果 needle 不是 haystack 的一部分，则返回  -1 。
 */
public class IsAnagram {
    public static boolean isAnagram(String s, String t) {
        String[] pArr = t.split("");
        String[] sArr = s.split("");
        //注意一下前后不一致的情况
        if(pArr.length!=sArr.length){
            return false;
        }
        Set<String> pSet = Arrays.stream(pArr).collect(Collectors.toSet());
        Set<String> sSet = Arrays.stream(sArr).collect(Collectors.toSet());
        if (pSet.size()!=sSet.size()){
            return false;
        }
        Map<String, Integer> pMap = new HashMap<>();
        Map<String, Integer> sMap = new HashMap<>();
        //统计P的字母出现的次数
        for (int i=0; i<pArr.length; i++){
            if(!pMap.containsKey(pArr[i])){
                pMap.put(pArr[i],1);
            }
            Integer value = pMap.get(pArr[i]);
            pMap.put(pArr[i],value+1);
        }
        //统计S中每个字母出现的次数
        for (int i = 0; i < sArr.length; i++) {
            if(!sMap.containsKey(sArr[i])){
                sMap.put(sArr[i],1);
            }
            Integer value = sMap.get(sArr[i]);
            sMap.put(sArr[i],value+1);
        }

        //对比p和s的字母出现的次数
        for (Map.Entry<String,Integer> entry: pMap.entrySet()) {
            String key = entry.getKey();
            if(!sMap.containsKey(key)){
                return false;
            }

            //Integer不能用等于号比较
            if (sMap.get(key).intValue() != pMap.get(key).intValue()){
                return false;
            }
            
        }
        return true;
    }


    public static void main(String[] args) {
        List<String[]> tests = new ArrayList();
        String[] test1 = new String[]{"",
                ""};
        String[] test2 = new String[]{"rat","car"};
        String[] test3 = new String[]{"aaaa","dog cat cat dog"};
        String[] test4 = new String[]{"aaa","dog cat cat dog"};
        String[] test5 = new String[]{"abc","aaa aaa aaa"};
        tests.add(test1);
        tests.add(test2);
        tests.add(test3);
        tests.add(test4);
        tests.add(test5);
        for (int i = 0; i < tests.size(); i++) {
            boolean result = IsAnagram.isAnagram(tests.get(i)[0],tests.get(i)[1]);
            System.out.println("第"+i+"个测试数据为:"+ StringUtils.stingArrayToString(tests.get(i))+"\n"+
                    "第"+i+"个计算结果为:"+result+"\n");
        }

    }
}
